import React from 'react';
import ReactDOM from 'react-dom';
import { Router, Route } from 'react-router-dom';
import './index.css';
import App from './App';

ReactDOM.render(<Router>
    <Route path="/" component={App} />
  </Router>, document.getElementById('root'));
